import axios from "axios";

const BASE_URL = "http://localhost:8080";

// Fetch agency details by ID
export const getAgencyDetails = async (agencyId) => {
  const response = await axios.get(`${BASE_URL}/api/car-rental-agencies/${agencyId}`);
  return response.data;
};

// Fetch list of cities
export const getCities = async () => {
  const response = await axios.get(`${BASE_URL}/cities`);
  return response.data;
};

// Update agency details
export const updateAgencyDetails = async (agencyId, updatedData) => {
  const response = await axios.put(`${BASE_URL}/api/car-rental-agencies/${agencyId}`, updatedData, {
    headers: { "Content-Type": "application/json" },
  });
  return response.data;
};
